import { Link } from "react-router-dom";
import { useEffect } from "react";
import { useDispatch } from "react-redux";

import './landing.css'

function Landing() {
   const dispatch = useDispatch()

   useEffect(() => {
      dispatch(getRazas())
      dispatch(getTemperaments())
   }, [dispatch])

   return (
      <div>
         <div className="welcome">
            <h2>¡Welcome Back!</h2>
         </div>
         <Link to='/home'>
            <button>¡Vamos!</button>
         </Link>
      </div>
   )
}

export default Landing;
